import React from "react";
import RenderNavbar from "./RenderNavbar";




const NavbarItem =(props)=>{
    
    console.log()
    return(
        <div>
            {
            props.items.map(navbar=>(
                <RenderNavbar
                    key={Math.random()}
                    icon={navbar.icon}
                    type={navbar.type}
                    active={navbar.active}
                ></RenderNavbar>
            ))
            }
        </div>
        
        
    )
  
};
export default NavbarItem;
